import { useEffect, useState } from "react";

import Grid from "./Grid";

import "../css/panel.css"

export default function Panel() {
    const [grid, setGrid] = useState<Grid | undefined>();

    useEffect(() => {
        setGrid(new Grid(50, 50));
    })

    return(
        <div>
            Hello
        </div>
    );
}
